enum class Direction{Up, Down, Left, Right};

struct NPC_Effect
{
  explicit NPC_Effect(){}
  explicit NPC_Effect(const long & width, const long & offset_x, const long & offset_y, const Image_Params & image, const long & animation_speed, const vector<long> & animation_list)
  {
    m_width = width;
    m_offset_x = offset_x;
    m_offset_y = offset_y;
    m_img_size = image.m_size;
    m_animation_speed = animation_speed;
    m_animation_list = animation_list;
    m_img_data = new unsigned char[m_img_size];
    ++mem;
    for(long k{0}; k < m_img_size; ++k)
    {
      m_img_data[k] = image.m_data[k];
    }
  }
  NPC_Effect & operator =(const NPC_Effect & obj)
  {
    if(this != &obj)
    {
      if(m_img_data != nullptr)
      {
        delete [] m_img_data;
        m_img_data = nullptr;
        --mem;
      }
      m_width = obj.m_width;
      m_offset_x = obj.m_offset_x;
      m_offset_y = obj.m_offset_y;
      m_img_size = obj.m_img_size;
      m_animation_speed = obj.m_animation_speed;
      m_animation_list = obj.m_animation_list;
      m_img_data = new unsigned char[m_img_size];
      ++mem;
      for(long k{0}; k < m_img_size; ++k)
      {
        m_img_data[k] = obj.m_img_data[k];
      }
    }
    return *this;
  }
  explicit NPC_Effect(const NPC_Effect & obj)
  {
    *this = obj;
  }
  long m_width{0};
  long m_offset_x{0};
  long m_offset_y{0};
  unsigned char* m_img_data{nullptr};
  long m_img_size{0};
  long m_animation_speed{0};
  vector<long> m_animation_list{};
  ~NPC_Effect()
  {
    if(m_img_data != nullptr)
    {
      delete [] m_img_data;
      m_img_data = nullptr;
      --mem;
    }
  }
};

