struct Hero_Data
{
  explicit Hero_Data(const long & layer = 0, const long & tile_x = 0, const long & tile_y = 0, const Direction & facing_dir = Direction::Down, const string & start_state = "NULL") : m_layer(layer), m_tile_x(tile_x), m_tile_y(tile_y), m_facing_dir(facing_dir), m_start_state(start_state){}
  long m_layer;
  long m_tile_x;
  long m_tile_y;
  Direction m_facing_dir;
  string m_start_state;
  ~Hero_Data(){}
};

struct NPC_Data
{
  NPC_Data(){}
  NPC_Data(const long & layer, const long & width, const long & tile_x, const long & tile_y, const Direction & facing_dir, const string & start_state, const double & move_speed, const bool & show_effect, const bool & loop, const bool & hidden, const long & animation_speed, const string & tex_id, const Image_Params & image, const NPC_Effect & effect, const vector<long> & scripts, const vector<vector<long>> & animation_list, const vector<vector<Direction>> & paths)
  {
    m_layer = layer;
    m_width = width;
    m_tile_x = tile_x;
    m_tile_y = tile_y;
    m_facing_dir = facing_dir;
    m_start_state = start_state;
    m_move_speed = move_speed;
    m_show_effect = show_effect;
    m_loop = loop;
    m_hidden = hidden;
    m_animation_speed = animation_speed;
    m_id = tex_id;
    m_img_size = image.m_size;
    m_effect = effect;
    m_paths = paths;
    m_animation_list = animation_list;
    m_scripts = scripts;
    m_img_data = new unsigned char[m_img_size];
    ++mem;
    for(long k{0}; k < m_img_size; ++k)
    {
      m_img_data[k] = image.m_data[k];
    }
  }
  NPC_Data & operator =(const NPC_Data & obj)
  {
    if(this != &obj)
    {
      if(m_img_data != nullptr)
      {
        delete [] m_img_data;
        m_img_data = nullptr;
        --mem;
      }
      m_layer = obj.m_layer;
      m_width = obj.m_width;
      m_tile_x = obj.m_tile_x;
      m_tile_y = obj.m_tile_y;
      m_facing_dir = obj.m_facing_dir;
      m_start_state = obj.m_start_state;
      m_move_speed = obj.m_move_speed;
      m_show_effect = obj.m_show_effect;
      m_loop = obj.m_loop;
      m_hidden = obj.m_hidden;
      m_animation_speed = obj.m_animation_speed;
      m_id = obj.m_id;
      m_img_size = obj.m_img_size;
      m_effect = obj.m_effect;
      m_paths = obj.m_paths;
      m_animation_list = obj.m_animation_list;
      m_scripts = obj.m_scripts;
      m_img_data = new unsigned char[m_img_size];
      ++mem;
      for(long k{0}; k < m_img_size; ++k)
      {
        m_img_data[k] = obj.m_img_data[k];
      }
    }
    return *this;
  }
  explicit NPC_Data(const NPC_Data & obj)
  {
    *this = obj;
  }
  long m_layer{0};
  long m_width{0};
  long m_tile_x{0};
  long m_tile_y{0};
  Direction m_facing_dir{Direction::Up};
  string m_start_state{"NULL"};
  double m_move_speed{0};
  bool m_show_effect{false};
  bool m_loop{false};
  bool m_hidden{true};
  long m_animation_speed{0};
  string m_id{"NULL"};
  unsigned char* m_img_data{nullptr};
  long m_img_size{0};
  NPC_Effect m_effect{};
  vector<vector<Direction>> m_paths{};
  vector<vector<long>> m_animation_list{};
  vector<long> m_scripts{};
  ~NPC_Data()
  {
    if(m_img_data != nullptr)
    {
      delete [] m_img_data;
      m_img_data = nullptr;
      --mem;
    }
  }
};

struct Trigger_Data
{
  Trigger_Data(const long & id, const long & l, const long & x, const long & y, const long & script) : m_id(id), m_l(l), m_x(x), m_y(y), m_script(script){}
  long m_id;
  long m_l;
  long m_x;
  long m_y;
  long m_script;
  ~Trigger_Data(){}
};

struct Map_Data
{
  explicit Map_Data(){}
  explicit Map_Data(const long & map_width, const long & map_height, const long & tile_width, const string & id, const Image_Params & image, const bool & show_hero, const string & music_name, const Hero_Data & hero_data, const vector<NPC_Data> & npc_data, const vector<Trigger_Data> & trigger_list, const vector<array<vector<long>, 2>> & tile_map, const vector<vector<bool>> & collision_map, const vector<Scr> & scripts)
  {
    m_map_width = map_width;
    m_map_height = map_height;
    m_tile_width = tile_width;
    m_id = id;
    m_img_size = image.m_size;
    m_show_hero = show_hero;
    m_music = music_name;
    m_hero_data = hero_data;
    m_npc_list = npc_data;
    m_trigger_list = trigger_list;
    m_tile_map = tile_map;
    m_collision_map = collision_map;
    m_scripts = scripts;
    m_img_data = new unsigned char[m_img_size];
    ++mem;
    for(long k{0}; k < m_img_size; ++k)
    {
      m_img_data[k] = image.m_data[k];
    }
  }
  Map_Data & operator =(const Map_Data & obj)
  {
    if(this != &obj)
    {
      if(m_img_data != nullptr)
      {
        delete [] m_img_data;
        m_img_data = nullptr;
        --mem;
      }
      m_map_width = obj.m_map_width;
      m_map_height = obj.m_map_height;
      m_tile_width = obj.m_tile_width;
      m_id = obj.m_id;
      m_img_size = obj.m_img_size;
      m_show_hero = obj.m_show_hero;
      m_music = obj.m_music;
      m_hero_data = obj.m_hero_data;
      m_npc_list = obj.m_npc_list;
      m_trigger_list = obj.m_trigger_list;
      m_tile_map = obj.m_tile_map;
      m_collision_map = obj.m_collision_map;
      m_scripts = obj.m_scripts;
      m_img_data = new unsigned char[m_img_size];
      ++mem;
      for(long k{0}; k < m_img_size; ++k)
      {
        m_img_data[k] = obj.m_img_data[k];
      }
    }
    return *this;
  }
  explicit Map_Data(const Map_Data & obj)
  {
    *this = obj;
  }
  long m_map_width{0};
  long m_map_height{0};
  long m_tile_width{0};
  string m_id{"NULL"};
  unsigned char* m_img_data{nullptr};
  long m_img_size{0};
  bool m_show_hero{false};
  string m_music{"City"};
  Hero_Data m_hero_data{};
  vector<NPC_Data> m_npc_list{};
  vector<Trigger_Data> m_trigger_list{};
  vector<array<vector<long>, 2>> m_tile_map{};
  vector<vector<bool>> m_collision_map{};
  vector<Scr> m_scripts{};
  ~Map_Data()
  {
    if(m_img_data != nullptr)
    {
      delete [] m_img_data;
      m_img_data = nullptr;
      --mem;
    }
  }
};

